import React from 'react';
import {
  AboutPage,
  ContactPage,
  LandingPagesection,
  NotFoundpage,
} from './pages/index';
import Signup from './components/Signup';
import Login from './components/Login';
import logoutButton from './components/logout';

import Profile from './components/Profile';

const App = () => {
  return (
    <>
    <main className='column'>
      <Login/>
      <LogoutButton/>
    </main>
    </>
  );
};

export default App;
